import React from "react";
import SHPContainer1 from "./styles/SHomePage";

const HomePage = () => {
  return (
    <HMcontainer1>
      <iframe
        src="https://calendar.google.com/calendar/embed?height=400&wkst=2&bgcolor=%234285F4&ctz=Europe%2FLisbon&mode=MONTH&showTz=0&showCalendars=0&showTabs=0&showPrint=0&showDate=1&showNav=1&showTitle=0&src=b2dhaXR3dGZAZ21haWwuY29t&src=cHQucG9ydHVndWVzZSNob2xpZGF5QGdyb3VwLnYuY2FsZW5kYXIuZ29vZ2xlLmNvbQ&color=%23039BE5&color=%230B8043"
        style="border:solid 1px #777"
        height="350px"
        width="96%"
        frameborder="0"
      ></iframe>
    </HMcontainer1>
  );
};

export default HomePage;
